import React, { Component } from 'react'

export class ShopCart extends Component {
  render() {
    return (
      <main className='shopCart'>
        {this.props.items.map(el => (
          <h1>{el.title}</h1>
        ))}
      </main>
    )
  }
}

export default ShopCart
